SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

CREATE TABLE IF NOT EXISTS tbl_attend (
  id int(11) NOT NULL AUTO_INCREMENT,
  file_no double NOT NULL,
  `date` date NOT NULL,
  in_time time NOT NULL,
  out_time time NOT NULL,
  `status` int(11) NOT NULL,
  over_time double NOT NULL,
  PRIMARY KEY (id)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=5074 ;


CREATE TABLE IF NOT EXISTS tbl_attend_in (
  file_no double NOT NULL,
  `date` date NOT NULL,
  in_time time NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS tbl_attend_out (
  file_no double NOT NULL,
  `date` date NOT NULL,
  out_time time NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


CREATE TABLE IF NOT EXISTS tbl_pre_attend (
  file_no double DEFAULT NULL,
  `date` date DEFAULT NULL,
  `time` time DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

